package Chap3;
//Exampe of Enhanched for Loop 

public class ExFor3 {
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String[] str={"Arun","Raju","Ramu"};
		
		for(String s:str)
		{
			System.out.println(s);
			
		}
		int[] x={10,20,30,40,50};
		for(Integer t:x)
		{
			System.out.println(+t);
		}
	}
}
